					var button = jQuery('<div id="swatchnumber-'+ i + '" class="ics-ge-preset"></div>').data('gradient', swatch);
			
					button.append(span);
			
					elements.swatches.append(jQuery('<li></li>').append(button));
					renderOutput(span, parseGradient(swatch));
